function Movie({ name }) {
  return <div>I like {name} movies!</div>;
}

const movieILike = [
  { name: "horor", image: "" },
  { name: "romance" },
  { name: "fantasy" },
  { name: "comic" }
];

function App() {
  return (
    <div className="App">
      <h1>eeeyeah!</h1>
      {movieILike.map(genre => <Movie name={genre.name} />)}
    </div>
  );
}

export default App;
